import React from 'react';
import './Content.css';

const Content = () => {
  const chumma = ['vanakam', 'hi', 'namaste'];
  
  return (
    <section className="content">
      <div className="content-container">
        <h1>{chumma.join(', ')}</h1> {/* Joining the array as a string */}
        <h1>Welcome to My Website</h1>
        <p>
          Hello guys I am Vasanthan from Sri Venkateshwaraa College of Engineering and Technology, Puducherry.
        </p>
        <p>
          This is a sample content page we created using React. Click on the button below to see our Day 4 Heart Animation project using Event Listener.
        </p>
        <button className="cta-button" onClick={() => window.location.href = '/index.html'}>
          Learn More
        </button>
      </div>
    </section>
  );
};

export default Content;
